import React from "react";


const StudentsCompanent = ({students}) => {
    return (
        <div>
            {students.map(p => 
            <div>
                <h1>{p.name}</h1>
                <p></p>
            </div>

            )}
        </div>
    )
}

export default StudentsCompanent
